  false,\n\t\"url\": null,\n\t\"notes\": \"The Refuge presents a burn proposal for
  Cormorant and Broken Gun Islands in Lake Onalaska. The plan is to burn one half
  of each island to rejuvenate the grass stands.  Only one half of each island will
  be burned in 1994. Refuge managers believe that a prescribed burn will provide a
  grazing site for Canada Geese and provide residual cover for next year's waterfowl.\",\n\t\"license_title\":
